column8:
代表純正番号：22448-4M50A<br>
代表車種：B15、U14、W11、Y11<br>
<br>
<br>
イグニッションコイルは、バッテリー電圧を点火プラグの火花放電に必要な数万ボルトに昇圧する装置で、日立製優良補修品はすべてダイレクトイグニッション方式となります。<br>
<br>
ダイレクトイグニッションとは、各シリンダーに一つずつイグニッションコイルをつけたものです。<br>
プラグコードを使っていないので、プラグコードによる故障が避けられます。<br>
かつ安定した点火火花を各気筒に供給できます。<br>
<br>
